INSERT INTO `app_group_note` (`id`, `group_id`, `userid`, `view`, `addtime`, `content`, `istop`, `imgs`, `uids`) VALUES
(1, 76645, 86418, 52, 1586090087, '22222333', 0, 'uploads/images/2020/04/05/5e89d05f850e8.jpeg|uploads/images/2020/04/05/5e89d063afc80.jpeg', NULL),
(0, NULL, 86418, 0, 1586135841, NULL, 0, NULL, NULL),
(4, 76645, 86418, 32, 1586136003, '　国家卫生健康委新闻发言人、宣传司副司长米锋通报了最新疫情情况。4月4日，现有本土重症病例降至300例以下，本土确诊病例降至700例以下，救治效果明显。国家高水平医疗团队继续坚守武汉，为重症患者“一人一策”制定治疗方案，提高治愈率。\n\n　　世界卫生组织最新通报，全球累计确诊病例已超过100万例，并再次强调要发现、检测、隔离和治疗每一个病例，追踪每一个接触者。境外疫情的扩散蔓延，对入境城市防控、救治和检测能力带来压力。要保持疫情防控力度，入境检疫、转运对接、医学观察、社区防控等环节要无缝衔接，严防漏洞。', 1, 'uploads/images/2020/04/06/5e8a83d8f1f18.jpeg', NULL),
(5, 11876, 67012, 21, 1586227789, '新的公告，不能发彩票有关的词汇', 0, '', NULL),
(6, 70675, 626544, 15, 1586247866, '随着新冠疫情的变化，国内企业复工复产已全面推开，生产重启和快速发展正逐步替代疫情防控成为经济工作重点。进入3月份以来，四次国常会三次提及“扩内需”和“扩大有效需求”，明确了经济发展的内核以及“核动力”所在，而新基建等基础设施投资的项目资金投放，流动性供给的充裕与财政措施不断加力，在激活大中小企业生产的同时，最终无不落脚于生产消费与生活消费这两类内需的有效循环和两者的良性互动，从而稳定预期，稳定经济增长。', 0, 'uploads/images/2020/04/07/5e8c38b96f148.jpeg', NULL),
(7, 737883, 666888, 129, 1586340237, '发布公告测试', 0, '', 'a:1:{i:0;N;}'),
(8, 947568, 86668, 904, 1586341120, '本群禁止发广告，只聊有关彩票计划的话题。否则一律踢~', 0, '', 'a:1:{i:0;N;}'),
