(10, 396190, 87222, 325, 1589731885, '本群为彩匠官方交流群，禁止发广告。文明交友，共创辉煌。公测期间有任何问题可向我们提出改善，一旦采纳奖励红包!', 0, '', 'a:1:{i:0;N;}'),
